(104, 1, '2014-06-02 10:09:26', '2014-06-02 17:09:26', '&nbsp;\r\n\r\n<span style="color: #222222;">he second stop of the tour was to meet with Meeky Blizzard at Piccolo Park in SE Portland. Meeky was co-founder of Sensible Transportation Options for People (STOP), which was at the heart of in stopping construction of the Western Bypass freeway. She detailed the beginnings of the Land Use, Transportation, and Air Quality (LUTRAQ) study, which was the first attempt in the country to empirically explore land use alternatives to highway construction. Findings from the study, in conjunction with Meeky and others’ activism, helped to ultimately redirect funds toward expanding public transit into previously under-served Portland neighborhoods. Piccolo Park itself is a part of related history, as it is situated on land from which homes were razed for the anticipated construction of the Mt. Hood Freeway in the 1970s. Transportation activism in the community at the time was successful in stopping that project from demolishing portions of long-standing SE Portland neighborhoods.</span>\r\n\r\n&nbsp;', 'An Interesting Article', '', 'publish', 'open', 'open', '', 'an-interesting-article', '', '', '2014-06-02 10:19:06', '2014-06-02 17:19:06', '', 14, 'http://localhost/PortlandLatrinalia/?page_id=104', 0, 'page', '', 0),
(110, 1, '2014-06-02 10:09:26', '2014-06-02 17:09:26', '<span style="color: #222222;">The second stop of the tour was to meet with Meeky Blizzard at Piccolo Park in SE Portland. Meeky was co-founder of Sensible Transportation Options for People (STOP), which was at the heart of in stopping construction of the Western Bypass freeway. She detailed the beginnings of the Land Use, Transportation, and Air Quality (LUTRAQ) study, which was the first attempt in the country to empirically explore land use alternatives to highway construction. Findings from the study, in conjunction with Meeky and others’ activism, helped to ultimately redirect funds toward expanding public transit into previously under-served Portland neighborhoods. Piccolo Park itself is a part of related history, as it is situated on land from which homes were razed for the anticipated construction of the Mt. Hood Freeway in the 1970s. Transportation activism in the community at the time was successful in stopping that project from demolishing portions of long-standing SE Portland neighborhoods.</span>\r\n\r\n&nbsp;', 'An Interesting Article', '', 'inherit', 'open', 'open', '', '104-revision-v1', '', '', '2014-06-02 10:09:26', '2014-06-02 17:09:26', '', 104, 'http://localhost/PortlandLatrinalia/?p=110', 0, 'revision', '', 0),
(111, 1, '2014-06-02 10:12:40', '2014-06-02 17:12:40', '&nbsp;\r\n\r\n[caption id="attachment_105" align="alignnone" width="300"]<a href="http://localhost/PortlandLatrinalia/wp-content/uploads/2014/06/IMG_0756-1024x768.jpg"><img class="size-medium wp-image-105" src="http://localhost/PortlandLatrinalia/wp-content/uploads/2014/06/IMG_0756-1024x768-300x225.jpg" alt="On Saturday, April 21st, DPC partnered with the Bus Project and Rebooting Democracy to lead “People Places Politics: A Tour of Portland’s Activist History.” 45 participants boarded the bus to take in sites and hear from guest speakers who addressed Portland’s many social movements. Here is a report back, courtesy of Sara Walker, a Bus Project volunteer; photos by Marc Moscato." width="300" height="225" /></a> On Saturday, April 21st, DPC partnered with the Bus Project and Rebooting Democracy to lead “People Places Politics: A Tour of Portland’s Activist History.” 45 participants boarded the bus to take in sites and hear from guest speakers who addressed Portland’s many social movements. Here is a report back, courtesy of Sara Walker, a Bus Project volunteer; photos by Marc Moscato.[/caption]\r\n\r\n<span style="color: #222222;">The second stop of the tour was to meet with Meeky Blizzard at Piccolo Park in SE Portland. Meeky was co-founder of Sensible Transportation Options for People (STOP), which was at the heart of in stopping construction of the Western Bypass freeway. She detailed the beginnings of the Land Use, Transportation, and Air Quality (LUTRAQ) study, which was the first attempt in the country to empirically explore land use alternatives to highway construction. Findings from the study, in conjunction with Meeky and others’ activism, helped to ultimately redirect funds toward expanding public transit into previously under-served Portland neighborhoods. Piccolo Park itself is a part of related history, as it is situated on land from which homes were razed for the anticipated construction of the Mt. Hood Freeway in the 1970s. Transportation activism in the community at the time was successful in stopping that project from demolishing portions of long-standing SE Portland neighborhoods.</span>\r\n\r\n&nbsp;', 'An Interesting Article', '', 'inherit', 'open', 'open', '', '104-revision-v1', '', '', '2014-06-02 10:12:40', '2014-06-02 17:12:40', '', 104, 'http://localhost/PortlandLatrinalia/?p=111', 0, 'revision', '', 0),
